        <g id="thoughts">
          <g>
            <text transform="matrix(1 0 0 1 357.0092 1987.4403)" class="st5 st6">Crossing the street cause it’s hot and there’s shadow on the other side</text>
          </g>
          <g>
            <rect x="450" y="2947.4" class="st7" width="311.2" height="40.3"/>
            <text transform="matrix(1 0 0 1 449.9668 2954.9294)"><tspan x="0" y="0" class="st5 st6">Morena complains about her right leg. She had a surgery a couple of years ago and </tspan><tspan x="0" y="10.8" class="st5 st6">since then she can’t work well. Her left foot is also in pain: she stepped on a piece </tspan><tspan x="0" y="21.6" class="st5 st6">of glass the week before.</tspan></text>
          </g>
          
            <image style="overflow:visible;" width="1058" height="750" xlink:href="../../img/morena/observation.png"  transform="matrix(2.896381e-02 0 0 2.896381e-02 415.034 2939.7031)">
          </image>
          
            <text transform="matrix(1 0 0 1 421.6108 2338.6042)" class="st5 st6">Hay que fresquito! She closes her eyes, and enjoys some breeze</text>
          
          
            <image style="overflow:visible;" width="1058" height="750" xlink:href="../../img/morena/observation.png"  transform="matrix(2.896381e-02 0 0 2.896381e-02 386.6784 2323.5769)">
          </image>
          <g>
            <text transform="matrix(1 0 0 1 405.6255 2196.2205)" class="st5 st6">Crochet murales that she likes (pic)</text>
          </g>

          </image>
          <g>
            <text transform="matrix(1 0 0 1 388.4131 2008.0887)" class="st5 st6">There’s the statue of a owl that makes a sound when someone passes</text>
          </g>
          
            <image style="overflow:visible;" width="1058" height="750" xlink:href="../../img/morena/observation.png"  transform="matrix(2.896381e-02 0 0 2.896381e-02 354.8296 1995.3937)">

          </image>
          <text transform="matrix(1 0 0 1 241.6582 1304.3676)" class="st1 st6">Dissapointed: “I think I only made 7-8 pesos, not more.”</text>
          <g>
            <text transform="matrix(1 0 0 1 638.6963 1071.1508)" class="st5 st6">There’s a cart locked to a street pole</text>

          <text transform="matrix(1 0 0 1 310.8408 1021.6884)"><tspan x="0" y="0" class="st1 st6">Three other canners passing by... </tspan><tspan x="124.4" y="0" class="st5 st6">Dekalb is better in the afternoon</tspan></text>

        <g id="encounters">
          <rect x="469.4" y="2838" class="st7" width="271.5" height="25.6"/>
          <text transform="matrix(1 0 0 1 469.3574 2845.5798)"><tspan x="0" y="0" class="st1 st6">Menonita church. People distributing free food outside, especially baked </tspan><tspan x="0" y="10.8" class="st1 st6">goods and vegetables. Morena gets some bread.</tspan></text>
          
            <image style="overflow:visible;" width="1030" height="1252" xlink:href="../../img/morena/hand.png"  transform="matrix(2.158347e-02 0 0 2.158347e-02 442.2473 2834.8337)">

          <rect x="201.7" y="2109.9" class="st7" width="216.2" height="34.7"/>
          <text transform="matrix(1 0 0 1 215.1933 2117.4333)"><tspan x="0" y="0" class="st1 st6">She meets two old men. One says to the other: “Rubio, </tspan><tspan x="3.5" y="10.8" class="st1 st6">ella es mi esposa,” pointing toward Morena. Rubio hit </tspan><tspan x="53.2" y="21.6" class="st1 st6">Morena’s cart with his cane to greet her.</tspan></text>
          
            <image style="overflow:visible;" width="1030" height="1252" xlink:href="../../img/morena/hand.png"  transform="matrix(2.158347e-02 0 0 2.158347e-02 423.8945 2110.6353)">
          </image>
          <text transform="matrix(1 0 0 1 305.0009 1714.6366)" class="st1 st6">She meets Chocolate, another canner at Sure We Can</text>

          </image>
          <text transform="matrix(1 0 0 1 161.2944 1074.8104)" class="st5 st6">Stop at an auto repair shop: “No party this saturday, I got nothing for you today”</text>
          
            <image style="overflow:visible;" width="1030" height="1252" xlink:href="../../img/morena/hand.png"  transform="matrix(2.158347e-02 0 0 2.158347e-02 465.3564 1060.3636)">
          </image>
          <rect x="624.3" y="702.9" class="st7" width="200.1" height="23.6"/>
          <text transform="matrix(1 0 0 1 624.3301 710.4247)"><tspan x="0" y="0" class="st5 st6">“Hey!”  </tspan><tspan x="26.9" y="0" class="st1 st6">to a man in the wheelchair, </tspan><tspan x="130" y="0" class="st5 st6">“The work to put </tspan><tspan x="0" y="10.8" class="st5 st6">together 5 pesos is hard!”</tspan></text>
          
            <image style="overflow:visible;" width="1030" height="1252" xlink:href="../../img/morena/hand.png"  transform="matrix(2.158347e-02 0 0 2.158347e-02 597.9982 691.3154)">
          </image>
          <text transform="matrix(1 0 0 1 393.5674 632.2269)"><tspan x="0" y="0" class="st5 st6">“¡Hola!” </tspan><tspan x="29.7" y="0" class="st1 st6">to a friend who’s passing by</tspan></text>
          
            <image style="overflow:visible;" width="1030" height="1252" xlink:href="../../img/morena/hand.png"  transform="matrix(2.158347e-02 0 0 2.158347e-02 532.0029 613.3868)">
          </image>

          <text transform="matrix(1 0 0 1 728.8711 583.6415)"><tspan x="0" y="0" class="st1 st6">She leaves her bag full of cans in the </tspan><tspan x="0" y="10.8" class="st1 st6">apartment of an old woman who </tspan><tspan x="0" y="21.6" class="st1 st6">keeps them for few hours</tspan></text>
